const employeeData = [
  {
    "first_name": "Alice",
    "last_name": "Adams"
  },
  {
    "first_name": "Bob",
    "last_name": "Bush"
  }
];

const count = (data) => {
  let counter = 0;
  data.forEach((item) => {
    counter++;
  });
  return counter;
};

export {
  employeeData,
  count
};
